    false,nt"url": null,nt"notes": "The wandering skipper (Panoquina errans)
    is a small butterfly of the family Hesperiidae. It is identifiable by its rich dark
    brown color and cream-colored spots on the dorsal forewing. The wandering skipper
    is found only along the coast in southern California, Baja California and northwestern
    mainland Mexico. Populations have been recorded from Huntington Beach, Upper Newport
    Bay, and Capistrano Beach. In San Diego, the wandering skipper has been documented
    in the Tijuana Estuary, San Dieguito Lagoon, and Agua Hedionda lagoon, but it appears
    that no extensive survey data have been published. The five lagoons surveyed were
    San Elijo, Los Penasquitos, Kendall-Frost, Famosa Slough, and Sweetwater marsh.
    Butterflies were detected using a Pollard walk with two observers moving along a
    line through potential habitat. Binoculars were used to aid visual identification.
    A handheld GPS unit was used to record the location of each individual detected;
    photos were taken when possible to confirm identification. Salt grass patches were
    also recorded using a handheld GPS device. Surveys were conducted in August through
    September of 2010 between the hours of 10am and 3pm. Temperature, wind speed, and
    cloud cover were recorded. This datalayer is a point file containing observations
    of the wandering skipper. Each of the 170 points represents an individual observation.
    The surveys were conducted by San Diego Associatation of Governments (SANDAG) staff
    and others.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
